import React from 'react';
import { Typography } from '@mui/material';

const Home = () => {
    return (
        <div style={{ textAlign: "center", padding: "20px" }}>
            <Typography variant="h2" gutterBottom>Bienvenue au tournoi de 32 joueurs</Typography>
            <Typography variant="h5">Sélectionnez une phase du tournoi pour voir les détails.</Typography>
        </div>
    );
};

export default Home;
